////////// METHOD //////////////
def ArrayList GetValueFromDb(String ConnectionString, String CommandTest){
	//ArrayList tmpValues = []; 
	def sql = Sql.newInstance(ConnectionString, "com.microsoft.sqlserver.jdbc.SQLServerDriver")
	def results = sql.rows(CommandTest)
	
	return results;
}

